import React from 'react'



const TreeItem = ({item, openNode}) => {

        <div style={{paddingLeft: '20px'}}>
            <h4 onClick={() => openNode(item.id)}>{item.title}</h4>
            {item.items && item.state === true ? <Tree items={item.items}/> : null}
        </div>

}


const Tree = ({items, openNode}) => <div>
    {items.map((i, key) => <TreeItem openNode={openNode} key={key} item={i}/>)}    
</div>


export default Tree;
